import { Fade } from "react-awesome-reveal";
import { Link } from "react-router-dom";
import './Home.css'

function Home() {
    return (
        <div className="home">
            <Fade>
                <div className="home_top">
                    <text className="home_banner">
                        Welcome to our Starbucks Online Store
                    </text>
                </div>
            </Fade>
        </div>
    );
}

export default Home;
